import React from 'react';

import './app.css';


const App = React.createClass({


  checkLocalStorage: function() {
    var test = 'localStorageTestAvailability';
    try {
       localStorage.setItem(test, test);
       localStorage.removeItem(test);
       return true;
    } catch (e) {
       return false;
    }
  },



  getInitialState: function() {

    var localStorageFolksonomy = [{ id: 'noMatch', desc: "Not the same person." }]

    if (this.checkLocalStorage()){
      var tmp = localStorage.getItem('ljUmbraFolksonomy');
      if (tmp){
        localStorageFolksonomy = JSON.parse(tmp)
      }
    }

    this.loadWork()

    // setInterval(()=>{
    //   this.loadWork()
    // },1000)

    return {
      active: null,
      history: [],
      folksonomy: localStorageFolksonomy,
      folksonomyEditing: false,
      user: null,
      totalLeft: null,
      error: null
    };
  },

  componentWillUpdate: function(nextProps,nextState){
  },

  render() {
    var self = this
    return (
      <div className='app'>
        <div className="aside">
          <div className="aside-active">
            <Person makeActive={self.makeActive} key={(this.state.active) ? this.state.active._id : "null"} data={this.state.active}/>
          </div>
          <div style={{textAlign:"center"}}><span>History</span></div>
          <div className="aside-history">
            {this.state.history.reverse().map(function(item,index){
                    return <Person makeActive={self.makeActive} key={item._id} data={item}/>
            })}
          </div>
        </div>
        <div className='main'>
                <div className="total-left" alt="Total left to work" title="Total left to work">{this.state.totalLeft}</div>
                <div onClick={this.editFolk} className="edit-folk"/>
                <div onClick={this.downloadData} className="download-data"/>
                <Login currentUser={this.state.user} setUser={this.setUser}/>
                <Folksonomy  folksonomy={this.state.folksonomy} folksonomyEditing={this.state.folksonomyEditing} setFolksonomy={this.setFolksonomy}/>
                <MainWork currentUser={this.state.user} folksonomy={this.state.folksonomy} folksonomyEditing={this.state.folksonomyEditing}  data={this.state.active} saveWork={this.saveWork}/>

        </div>

      </div>
    );
  },

  makeActive: function(data){
    this.setState({
        active: data
    });


  },

  editFolk: function(){
    this.setState({
        folksonomyEditing: true
    });
  },

  downloadData: function(){
    window.location='https://linkedjazz.org/umbra/api/v1/umbra?action=download'
  },


  loadWork: function(){
    var self = this

    var options = {
      'Accept': 'application/json',
      'Content-Type': 'application/json',
    };


    fetch('https://linkedjazz.org/umbra/api/v1/umbra?action=work')
      .then((res) => res.json())
      .then((json) => {
        var h = self.state.history
        if (self.state.active) h.push(self.state.active)
        self.setState({
          active: json,
          history: h,
          totalLeft: json.totalLeft
        });
      }).catch(err => {
        console.error(err);
        alert(err)
      });
  },

  saveWork: function(work){
    if (this.state.user.toLowerCase() !== 'demo'){
      work.user = this.state.user
      fetch('https://linkedjazz.org/umbra/api/v1/umbra?action=save', {
        method: 'POST',
        headers: {
          'Accept': 'application/json',
          'Content-Type': 'application/json'
        },
        body: JSON.stringify(work)
      })
    }



    this.loadWork()
  },

  setUser: function(value){
    this.setState({
        user: value
    });
  },
  setFolksonomy: function(value){
    this.setState({
        folksonomy: value,
        folksonomyEditing: false
    });

    //save it for later
    if (this.checkLocalStorage()){
      localStorage.setItem('ljUmbraFolksonomy', JSON.stringify(value));
    }
  }

});


const MainWork = React.createClass({

  getInitialState: function() {
    return {
      error: false
    };
  },

  imageError(){
    this.setState({
      error:true
    })
  },

  render() {
    var self = this;
    if (this.props.currentUser!==null && this.props.data !== null && this.props.folksonomyEditing === false){

        function createMarkup(html) { return {__html: html}; };


        return (
          <div className="work-item">
            <a href={this.props.data.isShownAt} target="_blank"><img ref="mainImage" src={this.props.data.object}/></a><br/>
            <a href={`https://www.umbrasearch.org/catalog/${this.props.data.hash}`} target="_blank"><span dangerouslySetInnerHTML={createMarkup(this.props.data.title)} /></a><br/>
            <span dangerouslySetInnerHTML={createMarkup(this.props.data.subjects)} /><br/>
            <span dangerouslySetInnerHTML={createMarkup(this.props.data.description)} /><br/>

          <div className="folk-work-holder">
            {this.props.folksonomy.map(function(item,index){
                    return <button key={item.id} className="buttonInactive" alt={item.desc} title={item.desc} onClick={self.toggle} ref={item.id}>{item.id}</button>
            })}
            <br/>
            <button className="buttonGo" onClick={this.save}>Save</button>
          </div>
          </div>
        );
    }else{
        return null
    }
  },

  save(){
    var results = []
    var noMatchUsed = false
    this.props.folksonomy.forEach((item) =>{
      if (this.refs[item.id].className==='buttonActive'){
        results.push(item)
        if (item.id==='noMatch') noMatchUsed = true
      }
      this.refs[item.id].className = 'buttonInactive'
    })
    if (results.length===0){
      alert('You must select one')
      return false
    }

    if (results.length>1 && noMatchUsed==true){
      alert('noMatch cannot be used with other predicates')
      return false
    }
    this.refs.mainImage.src = 'data:image/gif;base64,'

    this.props.saveWork({id: this.props.data._id, results: results})
  },

  toggle(event){
    if (event.target.className === 'buttonInactive'){
      event.target.className = 'buttonActive'
    }else{
      event.target.className = 'buttonInactive'
    }
  }
});


const Person = React.createClass({

  getInitialState: function() {
    return {
      error: false
    };
  },

  imageError(){
    this.setState({
      error:true
    })
  },
  render() {
    if (this.props.currentUser!==null && this.props.data !== null){
        var ljURI = this.props.data.name.replace(/\s/g,'_')
        var imgUrl = `https://linkedjazz.org/image/round/${ljURI}.png`
        if (this.state.error) imgUrl= 'https://linkedjazz.org/network/menu/no_image.png'
        return (
          <div className="person-item">
            <img onError={this.imageError} src={imgUrl} onClick={this.makeActive}/>
            <h3>{this.props.data.name}</h3>
            <a href={this.props.data.uri} target="_blank">URI</a><br/>
            <a href={`http://www.linkedjazz.org/resource/${ljURI}`} target="_blank">Linked Jazz</a>

          </div>
        );
    }else{
        return null
    }
  },
  makeActive(){
    this.props.makeActive(this.props.data)
  }


});



const Folksonomy = React.createClass({

  getInitialState: function() {
    return {
      folksonomy: this.props.folksonomy
    };
  },


  render() {
    var self = this
    if (this.props.folksonomyEditing){
        return (
          <div className="editing-folk">
            <div>Current Predicate Folksonomy</div>
            <div className="current-folk">
            {this.state.folksonomy.map(function(item,index){
                    return <div key={`folk-${index}`}>{item.id} - {item.desc} <button onClick={()=>self.removeExisting(item.id)}>Delete</button></div>
            })}
            </div>
            <hr/>
            Add More: <input ref="addNewInputId" placeholder="ID"></input> - <input ref="addNewInputDesc" placeholder="Description"></input> <button onClick={this.addNew}>Add</button>
            <br/>
            <br/>
            <button onClick={this.save}>SAVE</button>
          </div>
        );
    }else{
        return null
    }
  },

  removeExisting: function(removeId){
    if (removeId==='noMatch'){
        alert('Cannot remove noMatch');
        return false;
    }
    var f = [];
    this.state.folksonomy.forEach((v)=>{
        if (v.id!=removeId) f.push(v)
    })
    this.setState({
        folksonomy: f
    })
  },

  addNew: function(event){
    if (this.refs.addNewInputId.value.trim() === '' || this.refs.addNewInputDesc.value.trim() === ''){
        alert("Cannot have empty values");
        return false
    }
    var f = this.state.folksonomy
    f.push({ id: this.refs.addNewInputId.value, desc: this.refs.addNewInputDesc.value })
    this.setState({
        folksonomy: f
    })
    this.refs.addNewInputId.value = ""
    this.refs.addNewInputDesc.value = ""
  },
  save: function(){
    this.props.setFolksonomy(this.state.folksonomy)
  }


});

const Login = React.createClass({
  render() {
    if (this.props.currentUser===null){
        return (
          <div>
            <div className="logo">
            <img src="data:image/png;base64,"/>
            </div>
            <div className="login">
              <h3>Your Identifier</h3>
              <input onKeyPress={this.keyPress}></input>
              <button onClick={this.setUser}>Okay</button>
            </div>
          </div>
        );
    }else{
        return null
    }
  },
  keyPress: function(event){
    this.setState({name:event.target.value})
  },
  setUser: function(){
    this.props.setUser(this.state.name)
  }
});


export default App;
